import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import "../App.css"

function CarList() {
    const [cars, setCars] = useState([]);

    useEffect(() => {
      axios
        .get('http://localhost:5000/cars')
        .then((response) => {
          setCars(response.data);
        })
        .catch((error) => {
          console.error(error);
        });
    }, []);

    return (
      <div className="bg-red rounded shadow p-4 center carlist">
        <nav className="flex justify-between mb-4">
        <div className="flex items-center">
          <h1 className="text-red text-3xl font-bold mr-4">Car List</h1>
          <Link to="/add" className="text-gray-500 hover:text-gray-700 mr-4">Add Car</Link>
          <Link to="/update" className="text-gray-500 hover:text-gray-700 mr-4">Update Car</Link>
            </div>
        <div>
          <Link to="/delete" className="text-gray-500 hover:text-gray-700">Delete Car</Link>
        </div>
      </nav>

        <h1 className="text-3xl font-bold mb-4">Car List</h1>
        <ul>
          {cars.map((car) => (
            <li key={car.id} className="flex items-center justify-between">
              <div className="text-lg font-medium">{car.make} {car.model}</div>
              <div className="text-gray-500">{car.year}</div>
            </li>
          ))}
        </ul>
      </div>
    );
  }

  export default CarList;
